window.bookSummaryJSON = "<p><b>From Amazon bestselling author Jescie Hall comes a new dark college romance about one man's online obsession with his new stepsister.</b></p> <p><b>K1ngK0br@</b></p> <p>I fell for your lies, and you sucked me into your twisted game. You made me crave your taste, hungered for your full attention. I gave you everything, only for you to go ghost. You hollowed my heart, sending me into a spiral of self-destruction. Revenge found its way to replace you. Even if you're my new stepsister, I'll make sure hating me is your new addiction.</p> <p><b>vEn0mX</b></p> <p>You stole my heart, but I stole your livelihood. Playing off men and their desires became my obsession, until the game grew dark, and a body was never found. Deceptions, secrets, and a dark, devious mission led me to you. Fate found us, but trauma laced our cores. You want me to hate you, but I'll burn through the monster I created and make you love me again.</p> <p><i>Narrated in duet style.</i></p>"; 
